import React from "react";

const Card = ({ photo, text, onClick }) => {
  return (
    <div className="card" onClick={onClick}>
      <img src={photo} alt="Card" className="card-image" />
      <p className="card-text">{text}</p>
    </div>
  );
};

export default Card;
